import React from 'react';
import './Projects.css';

const Projects = () => {
  const projects = [
    {
      id: 1,
      title: "UX Club Platform",
      description: "A comprehensive platform for UX professionals to connect, share knowledge, and collaborate on projects.",
      image: "/src/assets/images/projects/Club.jpeg",
      tags: ["UX Design", "Web App", "Community"]
    },
    {
      id: 2,
      title: "Leo Project",
      description: "An innovative mobile application focused on personal productivity and task management.",
      image: "/src/assets/images/projects/Leo.png",
      tags: ["Mobile App", "Productivity", "UI Design"]
    },
    {
      id: 3,
      title: "Representation App",
      description: "A platform designed to promote diversity and inclusion in the workplace.",
      image: "/src/assets/images/projects/Rep.png",
      tags: ["Social Impact", "Web Platform", "Research"]
    },
    {
      id: 4,
      title: "Tak Design System",
      description: "A comprehensive design system and component library for consistent user experiences.",
      image: "/src/assets/images/projects/Tak.png",
      tags: ["Design System", "Components", "Documentation"]
    }
  ];

  return (
    <section id="projects" className="projects">
      <div className="projects-container">
        <h2 className="projects-title">Featured Projects</h2>
        <div className="projects-grid">
          {projects.map((project) => (
            <div key={project.id} className="project-card">
              <div className="project-image">
                <img src={project.image} alt={project.title} />
              </div>
              <div className="project-content">
                <h3 className="project-title">{project.title}</h3>
                <p className="project-description">{project.description}</p>
                <div className="project-tags">
                  {project.tags.map((tag, index) => (
                    <span key={index} className="project-tag">{tag}</span>
                  ))}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
